INSERT INTO `sys_new_book` VALUES ('2376340671195971584', '斗破苍穹 . 1  : 废柴当自强', '武汉:湖北少年儿童出版社 ,2010.7', '2010.7', '天蚕土豆著', '978-7-5353-5125-8', 'I247.59', '238043', 'i_biblios', '天才少年萧炎在创造了家族空前绝后的修炼纪录后突然成了废人，整整三年时间，家族冷遇，旁人轻视，被未婚妻退婚……种种打击接踵而至。就在他即将绝望的时候，一缕幽魂从他手上的戒指里浮现，一扇全新的大门在面前开启!', '/book.gif', NULL);
INSERT INTO `sys_new_book` VALUES ('2376340671195971585', '斗破苍穹 . 6  : 炼药师大会', '武汉:湖北少年儿童出版社 ,2011.6', '2011.6', '天蚕土豆著', '978-7-5353-5980-3', 'I247.59', '239114', 'i_biblios', '天才少年萧炎在创造了家族空前绝后的修炼纪录后突然成了废人，整整三年时间，家族冷遇，旁人轻视，被未婚妻退婚……种种打击接踵而至。就在他即将绝望的时候，一缕幽魂从他手上的戒指里浮现，一扇全新的大门在面前开启……', '/book.gif', NULL);
INSERT INTO `sys_new_book` VALUES ('2376340671195971586', '斗破苍穹 . 4  : 吞噬异火', '武汉:湖北少年儿童出版社 ,2011.5', '2011.5', '天蚕土豆著', '978-7-5353-5978-0', 'I247.59', '240302', 'i_biblios', '年度最值得期待的东方幻想长篇巨制！萧炎：男主角，萧家历史上空前绝后的斗气修炼天才。4岁就开始修炼斗之气，10岁拥有了九段斗之气，11岁突破十段斗之气，一跃成为家族百年来最年轻的斗者。然而在12岁那年，他却“丧失”了修炼能力，只拥有三段斗之气。直到15岁时，他偶获奇遇，重拾修炼的天赋。', '/book.gif', NULL);
