INSERT INTO `sys_new_book` VALUES ('2376340671195971589', '欢乐', '上海:上海文艺出版社 ,2010.8', '2010.8', '莫言', '978-7-5321-3949-1', 'I247.57', '227764', 'i_biblios', ' 收入本集的八部中篇，皆作于八十年代。《流水》最早，大约完成于1983年。此作遭遇数次退稿后，即丧失信心，掷之箱底，羞于拿出示人。后因《透明的红萝卜》等作走红，登门约稿者络绎不绝，遂从箱底取出，竟被故乡刊物《风流》发表在1985第二期上。此作可以明显看出我早期所受“白洋淀派”的影响，以及主题先行创作观念的痕迹。', '/book.gif', NULL);
